// Optimize prompts for the specific video engine
const scenes = $input.item.json.scenes || [];
const videoEngine = $('Extract Parameters').item.json.videoEngine;

const optimizedScenes = scenes.map(scene => {
  let optimizedPrompt = scene.prompt;

  // Add engine-specific optimizations
  if (videoEngine.includes('Veo')) {
    // Veo 3 works well with detailed cinematic prompts
    optimizedPrompt = `Cinematic shot: ${scene.prompt}. Camera: ${scene.cameraMovement}. Lighting: professional, ${scene.mood} atmosphere.`;
  } else if (videoEngine.includes('Runway')) {
    // Runway works well with motion-focused prompts
    optimizedPrompt = `${scene.prompt}. Motion: ${scene.cameraMovement}. Style: ${$('Extract Parameters').item.json.visualStyle}.`;
  } else if (videoEngine.includes('Luma')) {
    // Luma Dream Machine likes vivid, descriptive prompts
    optimizedPrompt = `${scene.prompt}, ${scene.mood} atmosphere, cinematic lighting, high quality, detailed`;
  } else {
    // Default optimization
    optimizedPrompt = `${scene.prompt}. ${scene.cameraMovement}. ${scene.mood} mood.`;
  }

  return {
    ...scene,
    prompt: optimizedPrompt,
    originalPrompt: scene.prompt
  };
});

return {
  ...($input.item.json),
  scenes: optimizedScenes
};

